import React from "react";
import { Link, Routes, Route } from "react-router-dom";
import HomeTickets from "./HomeTickets";
import ConcertTickets from "./ConcertTickets";
import AdaugaConcert from "./AdaugaConcert";
import EditeazaConcert from "./EditeazaConcert";

function Navbar() {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/home">Home</Link>
        </li>
        <li>
          <Link to="/">Concert Tickets</Link>
        </li>
        <li>
          <Link to="/adauga-concert">Adauga Concert</Link>
        </li>
        <li>
          <Link to="/editeaza-concert">Editeaza Concert</Link>
        </li>
      </ul>
    </nav>
  );
}

function Header() {
  return (
    <header>
      <img src="path/to/header-image.jpg" alt="Header Image" />
    </header>
  );
}

function HomePage() {
  return (
    <div className="home-page">
      <Header />
      <section>
        <h2>Welcome to the Home Page</h2>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla varius
          sem vitae urna accumsan, nec placerat ex consectetur. Vestibulum ac
          quam id quam cursus fermentum. Sed quis magna interdum, hendrerit quam
          sed, tincidunt lorem. Phasellus vitae tortor at mauris volutpat
          egestas non id erat. Nam euismod tristique dolor, in ultricies odio
          vulputate ac. Donec maximus, leo ac consequat cursus, ex est varius
          erat, non hendrerit sem enim vitae justo. Donec vitae erat in nisi
          dapibus eleifend in et massa.
        </p>
      </section>
    </div>
  );
}

function App() {
  return (
    <div>
      <Navbar />

      <Routes>
        <Route path="/home" element={<HomeTickets />} />
        <Route path="/" element={<ConcertTickets />} />
        <Route path="/adauga-concert" element={<AdaugaConcert />} />
        <Route path="/editeaza-concert" element={<EditeazaConcert />} />
      </Routes>
    </div>
  );
}

export default App;
